import { useNavigate } from 'react-router-dom';

function Navbar({ setToken }) {
  const navigate = useNavigate();

  const handleLogout = () => {
    setToken(null);
    navigate('/login');
  };

  return (
    <nav className="dark-green p-4 flex justify-between">
      <div className="flex space-x-4">
        <span>Fish & Greens</span>
        <button className="yellow-text" onClick={() => navigate('/dashboard')}>
          Главная
        </button>
        <button className="yellow-text" onClick={() => navigate('/plants')}>
          Наши растения
        </button>
      </div>
      <button onClick={handleLogout} className="yellow-text">
        Выход
      </button>
    </nav>
  );
}

export default Navbar;
